const canvas = document.getElementById('designCanvas');
const ctx = canvas.getContext('2d');
let uploadedImage = null;
let offsetX = 0, offsetY = 0, scale = 1, dragging = false;

const zones = {
  front: "data:image/png;base64,",
  back: "data:image/png;base64,",
  sleeve: "data:image/png;base64,"
};

function changeZone() {
  drawCanvas();
}

function loadImage(event) {
  const reader = new FileReader();
  reader.onload = function(e) {
    const img = new Image();
    img.onload = function() {
      uploadedImage = img;
      offsetX = canvas.width / 2 - img.width / 4;
      offsetY = canvas.height / 2 - img.height / 4;
      scale = 0.5;
      drawCanvas();
    };
    img.src = e.target.result;
  };
  reader.readAsDataURL(event.target.files[0]);
}

function drawCanvas() {
  const zone = document.getElementById("zoneSelect").value;
  const bg = new Image();
  bg.onload = function () {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.drawImage(bg, 0, 0, canvas.width, canvas.height);
    if (uploadedImage) {
      ctx.drawImage(
        uploadedImage,
        offsetX,
        offsetY,
        uploadedImage.width * scale,
        uploadedImage.height * scale
      );
    }
  };
  bg.src = zones[zone];
}

canvas.addEventListener("mousedown", () => dragging = true);
canvas.addEventListener("mouseup", () => dragging = false);
canvas.addEventListener("mousemove", e => {
  if (!dragging || !uploadedImage) return;
  const rect = canvas.getBoundingClientRect();
  offsetX = e.clientX - rect.left - (uploadedImage.width * scale) / 2;
  offsetY = e.clientY - rect.top - (uploadedImage.height * scale) / 2;
  drawCanvas();
});
canvas.addEventListener("wheel", e => {
  if (!uploadedImage) return;
  e.preventDefault();
  scale += e.deltaY < 0 ? 0.05 : -0.05;
  if (scale < 0.1) scale = 0.1;
  drawCanvas();
});

function saveDesign() {
  const image = canvas.toDataURL("image/png");
  document.getElementById("resultImage").src = image;
}

drawCanvas();